temp2 = load('MNISTData.mat'); % The MNISTData structure contains the DATA of the 4x data files.
TrainingSetImages = temp2.TrainingSetImages;
TrainingSetLabels = temp2.TrainingSetLabels;
TestSetImages = temp2.TestSetImages;
TestSetLabels = temp2.TestSetLabels;
%%
% Visualize select random samples

% View image and label
figure('Name',['set = ',set]) %[output:5015d9d5]
k = 1;
for m = 1:M %[output:group:8148d596]
    for n = 1:N
        subplot(M,N,k) %[output:5015d9d5]

        % Choose a random index.

        % Switch block to: Handles different cases based on the value of
        % SET.
        switch set
            case 'training'
                numImages = length(TrainingSetLabels);

            case 'testing'
                numImages = length(TestSetLabels);

            otherwise
                error('Unsupported set')
        end
        % SWITCH block summary: this code section determines the number of
        % images to work with based on whether you're dealing with TRAINING
        % or TESTING data, or throws an error if the set value is
        % unsupported.

        idx = floor(rand(1)*numImages); % Random number gen based off numImages, rounds towards negative infinity (rounds down).

        % Choose which set of data.
        switch set
            case 'training'
                A = TrainingSetImages(:,:,idx);
                label = TrainingSetLabels(idx);

            case 'testing'
                A = TestSetImages(:,:,idx);
                label = TestSetLabels(idx);

            otherwise
                error('Unsupported set')
        end

        imshow(A)
        title(['idx ', num2str(idx), ', Label ', num2str(label)])

        k = k + 1;
    end
end %[output:group:8148d596]
